import React, { useEffect, useState } from 'react';
import axios from 'axios';

import DailyTasks from './components/DailyTasks';
import AddTask     from './components/AddTask';
import Stats       from './components/Stats';

function App() {
  const [tasks, setTasks]       = useState([]);
  const [doneToday, setDoneToday] = useState([]);
  const [weekly, setWeekly]     = useState([]);
  const [info, setInfo]         = useState({ date:'', lunar:'', weather:'', fortune:'' });
  const [page, setPage]         = useState('daily'); // 'daily' | 'add' | 'stats'

  const loadData = async () => {
    try {
      const { data: info }   = await axios.get('http://localhost:5000/api/current_info');
      const { data: tRes }   = await axios.get('http://localhost:5000/api/tasks');
      const today            = info.date;
      const { data: dRes }   = await axios.get(`http://localhost:5000/api/daily_records?date=${today}`);
      const { data: wRes }   = await axios.get('http://localhost:5000/api/weekly_records');
      setInfo(info);
      setTasks(tRes.tasks);
      setDoneToday(dRes.done_tasks);
      setWeekly(wRes.weekly);
    } catch (e) {
      console.error(e);
    }
  };

  useEffect(() => { loadData(); }, []);

  const toggleTask = async (taskId, done) => {
    await axios.post('http://localhost:5000/api/daily_records', {
      date: info.date, task_id: taskId, done
    });
    setDoneToday(dt => done ? [...dt,taskId] : dt.filter(id=>id!==taskId));
    const { data: wRes } = await axios.get('http://localhost:5000/api/weekly_records');
    setWeekly(wRes.weekly);
  };

  const addTask = async name => {
    await axios.post('http://localhost:5000/api/tasks', { name });
    const { data } = await axios.get('http://localhost:5000/api/tasks');
    setTasks(data.tasks);
    const { data: wRes } = await axios.get('http://localhost:5000/api/weekly_records');
    setWeekly(wRes.weekly);
  };

  return (
    <div style={{ display:'flex', height:'100vh', fontFamily:'sans-serif' }}>
      {/* 侧边栏 */}
      <nav style={{
        width: 120, borderRight:'1px solid #ddd', padding:'20px',
        boxSizing:'border-box'
      }}>
        <div
          onClick={()=>setPage('daily')}
          style={{ marginBottom:12, cursor:'pointer', color: page==='daily' ? 'blue':'black' }}
        >每日打卡</div>
        <div
          onClick={()=>setPage('add')}
          style={{ marginBottom:12, cursor:'pointer', color: page==='add' ? 'blue':'black' }}
        >添加任务</div>
        <div
          onClick={()=>setPage('stats')}
          style={{ marginBottom:12, cursor:'pointer', color: page==='stats' ? 'blue':'black' }}
        >记录</div>
      </nav>

      {/* 主内容区 */}
      <main style={{ flex:1, padding:'20px', overflowY:'auto' }}>
        <h2>每日任务打卡 MVP</h2>
        {/* 今日信息栏 */}
        <div style={{ marginBottom:16, borderBottom:'1px solid #ccc', paddingBottom:8 }}>
          <div><strong>日期：</strong>{info.date}</div>
          <div><strong>农历：</strong>{info.lunar}</div>
          <div><strong>天气：</strong>{info.weather}</div>
          <div><strong>运势：</strong>{info.fortune}</div>
        </div>

        {page === 'daily' &&
          <DailyTasks
            tasks={tasks}
            doneToday={doneToday}
            weekly={weekly}
            onToggle={toggleTask}
          />}

        {page === 'add' &&
          <AddTask onTaskAdded={addTask} />}

        {page === 'stats' &&
          <Stats weekly={weekly} tasks={tasks} />}
      </main>
    </div>
  );
}

export default App;
